script: |
  super -f text -I q12497.spq | sort > q12497.out

inputs:
  - name: q12497.spq
    data: |
      SELECT DISTINCT + - COUNT ( * ) FROM tab1 (FORMAT parquet) AS cor0 WHERE 28 * + + col1 NOT BETWEEN col0 / + ( - - col1 ) + col1 / + col1 AND + - 60;
  - name: tab1

outputs:
  - name: q12497.out
    data: |
      -3
